DROP TABLE IF EXISTS `cap_pre_approval`;
CREATE TABLE `cap_pre_approval` (
  `id` varchar(64) NOT NULL COMMENT '预审id（自动生成）',
  `filler` varchar(64) DEFAULT NULL COMMENT '填报人（手动填写）',
  `filler_id` varchar(64) DEFAULT NULL COMMENT 'wechat_user里用户的id',
  `phone` varchar(64) DEFAULT NULL COMMENT '手机号（手动填写）',
  `service_kind` int DEFAULT NULL COMMENT '业务分类（字典service_type:1个人2企业）',
  `service_type` int DEFAULT NULL COMMENT '业务类型（字典service_type)',
  `service_name` int DEFAULT NULL COMMENT '业务名称（字典service_name）',
  `service_child_type` int DEFAULT NULL COMMENT '业务子类（字典service_child_type）',
  `submit_date` datetime DEFAULT NULL COMMENT '提交日期',
  `company_name` varchar(64) DEFAULT NULL COMMENT '企业名称',
  `company_credit_code` varchar(64) DEFAULT NULL COMMENT '企业信用代码',
  `approval_status` int DEFAULT NULL COMMENT '预审状态（字典approval_status:0保存1取消2通过3不通过4回退）\r\n            流程名称：用户填写 预审 终审 归档',
  `preapproval_num` varchar(64) DEFAULT NULL COMMENT '预审编号自动生成',
  `assign_type` int DEFAULT NULL COMMENT '分派形式（预留字段,字典assign_type:0自动分派-默认，1手动分派）',
  `proc_ins_id` varchar(64) DEFAULT NULL COMMENT '流程实例id',
  `task_status` int DEFAULT NULL COMMENT '签收状态（字典task_status：0未签收1已签收）',
  `preapproval_dept` varchar(64) DEFAULT NULL COMMENT '预审部门（sys_office的id）',
  `preapproval_person` varchar(64) DEFAULT NULL COMMENT '预审人员（sys_user的id）',
  `handle_type` int DEFAULT NULL COMMENT '办理方式（字典handle_type:1直接办理2邮寄办理3现场办理）',
  `preapproval_suggestion` text COMMENT '预审意见',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int DEFAULT NULL COMMENT '删除标识（字典del_flag:0无效1有效）',
  `remarks` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

